<?xml version="1.0" encoding="UTF-8"?>
<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd">
<html xmlns="http://www.w3.org/1999/xhtml">
<head>
<title>Nav Page</title>
<meta http-equiv="Content-Type" content="text/html; charset=ISO-8859-1" />
<script language="JavaScript" type="text/javascript">
function getUrl(){
	document.value=parent.Content.location.href;
	parent.Content.focus();
}
</script>
</head>

<body leftmargin="0" topmargin="0">
<a name="a"></a>
<table width="100%" height="100%" border="0" cellpadding="0" cellspacing="0" bgcolor="#F5F6F7">
  <tr bordercolor="#F5F6F7">
      <td width="47%" align="left" valign="middle">
        <table width="100%" border="0" cellspacing="0" cellpadding="0">
        <tr>
          <td width="49"><font size="2">
            Address:</font></td>
          <td width="263"><font size="2">
            <input name="address" type="file" id="address" />
          </font></td>
          <td width="5">&nbsp;</td>
          <td width="45"><table width="96%" border="0" cellspacing="0" cellpadding="0" onclick="parent.Content.location.href=address.value">
              <tr>
                <td width="22"><input name="goGet" type="image" class="navButton" value="Go" src="../../images/icons/internet/go.gif" /></td>
                <td><font size="2">Go</font></td>
              </tr>
            </table></td>
          <td width="6">&nbsp;</td>
        </tr>
      </table>

      </td>
      <td align="left" valign="middle"><table width="106" border="1" align="right" cellpadding="0" cellspacing="0" bordercolor="#333333">
        <tr bordercolor="#999999">
          <td width="50" onclick="javascript:history.go(-1);getUrl()"><div align="center"><a href="#a"><img alt="" src="../../images/icons/internet/back.gif" border="0" /></a></div></td>
          <td width="50" onclick="javascript:history.go(1);getUrl()"><div align="center"><a href="#a"><img alt="" src="../../images/icons/internet/foward.gif" border="0" /></a></div></td>
        </tr>
      </table></td>
      <td width="1%" align="right" valign="middle">&nbsp;</td>
  </tr>
  <tr bordercolor="#F5F6F7" bgcolor="#666666">
    <td height="1" colspan="3" align="left" valign="middle"></td>
  </tr>
</table>
</body>
</html>
